var input = [];
input[0] = '';
input[1] = '';
input[2] = '';
input[3] = '';
input[4] = '';

var keypad = [['0','0','1','0','0'],['0','2','3','4','0'],['5','6','7','8','9'],['0','A','B','C','0'],['0','0','D','0','0']];
var x = 2;
var y = 0;

for (var i = 0; i < input.length; i++) { //input.length
	var inputs = input[i].split('');
	for (var ii = 0; ii < inputs.length; ii++) {
		if (inputs[ii] == 'U') {
			if (x > 0 && keypad[x-1][y] != '0') {
				x -= 1;
			}
		}
		if (inputs[ii] == 'R') {
			if (y < 4 && keypad[x][y+1] != '0') {
				y += 1;
			}
		}
		if (inputs[ii] == 'D') {
			if (x < 4 && keypad[x+1][y] != '0') {
				x += 1;
			}
		}
		if (inputs[ii] == 'L') {
			if (y > 0 && keypad[x][y-1] != '0') {
				y -= 1;
			}
		}
	}
	console.log('key[' + i + ']: ' + keypad[x][y]);
}
